def generate_insert_query(data, table_name):
    columns = data[0].keys()

    values_list = []
    for entry in data:
        values = [entry[col] if entry[col] is not None else 'NULL' for col in columns]
        values.append("2024-07-12 00:00:00")
        formatted_values = [
            f"'{value}'" if isinstance(value, str) or value == 'NULL' else str(value)
            for value in values
        ]
        values_list.append(f"({', '.join(formatted_values)})")

    query = f"INSERT INTO {table_name} ({', '.join(columns)}, created_at) VALUES {', '.join(values_list)};"
    return query


